import React from 'react'
import styled from 'styled-components'
import Waves from '../background/Waves';
import Form from "../components/Form"

const Index = () => {
    return (
        <Wrapper>
            <Waves />
            <Form />
        </Wrapper>
    )
}

export default Index

const Wrapper = styled.div `
    height: 1247px;
    width: 100%;

`
